import React, { useState } from "react";
import './Styles/App.css'
import Box9x9 from "./Components/Box9x9/Box9x9";

function App() {
  const [sign, setSign] = useState('LT1');
  function getId(element){
    return setSign(element)
  }
  function changeColor(sid){
    var elem = document.getElementById(sid);
    var typedisp = window.getComputedStyle(elem, null).backgroundColor;
    typedisp = typedisp === 'Blue' ? 'Red' : 'Blue';
    elem.style.backgroundColor = typedisp;
  }
  return (
    <div className="App" >
      <div> {sign}</div>
      <Box9x9 getId={changeColor}/>
    </div>
  );
}

export default App;
